  false,\n\t\"url\": null,\n\t\"notes\": \" This dataset includes buildings occupied
  by the headquarters of cabinet leveln                state government executive
  departments, legislative offices buildings outside of then                capitol
  building, offices and court rooms associated with the highest level of then                judicial
  branch of the state government, and large multi-agency state officen                buildings.
  Because the research to create this data was primarily keyed off of then                headquarters
  of cabinet level state government agencies, some state office buildingsn                that
  don't house a headquarters for such an agency may have been excluded.n                Intentionally
  excluded from this dataset are government run institutions (e.g.n                schools,
  colleges, prisons, and libraries). Also excluded are state capitoln                buildings.
  State owned or leased buildings whose primary purpose is not to housen                state
  offices have also been intentionally excluded from this dataset. Examples ofn                these
  include \"Salt Domes\", \"Park Shelters\", and \"Highway Garages\". All entitiesn
  \               that have been verified to have no building name, have had their
  [NAME] attributen                set to \"NO NAME\". If the record in the original
  source data had no building name andn                TGS was unable to verify the
  building name, the [NAME] attribute was set ton                \"UNKNOWN\". All
  phone numbers in this dataset have been verified by TGS to be then                main
  phone for the building. If the building was verified not to have a main phonen                number,
  the [AREA] and [PHONE] fields have been left blank. All entities located onn                military
  bases have been removed from this dataset. The text fields in this datasetn                have
  been set to all upper case to facilitate consistent database engine searchn                results.
  All diacritics (e.g., the German umlaut or the Spanish tilde) have beenn                replaced
  with their closest equivalent English character to facilitate use withn                database
  systems that may not support diacritics. The currentness of this dataset isn                indicated
  by the [CONTDATE] attribute. Based upon this attribute, the oldest recordn                dates
  from 2007/12/03 and the newest record dates from 2007/12/06. \",\n\t\"license_title\":
